/*
	For /signup form page

	Dependencies:
		JQeury
		CryptoJS
 */

(function() {
  $("#signup").submit(function(e) {
    var data;
    e.preventDefault();
    data = {
      firstName: $("#firstName").val(),
      lastName: $("#lastName").val(),
      username: $("#username").val(),
      email: $("#email").val(),
      password: CryptoJS.SHA256($("#password").val()).toString(CryptoJS.enc.Hex)
    };
    return $.ajax({
      url: "/signup",
      type: "POST",
      ajax: "true",
      data: JSON.stringify(data),
      cache: false,
      contentType: "application/json",
      processData: false,
      success: function(res) {
        return $("#test").html(res);
      },
      error: function(res) {
        return $("#test").html("Error!");
      }
    });
  });

}).call(this);
